const alice = `CHAPTER I. Down the Rabbit-Hole

Alice was beginning to get very tired of sitting by her sister on the bank, and of having nothing to do: once or twice she had peeped into the book her sister was reading, but it had no pictures or conversations in it, 'and what is the use of a book,' thought Alice 'without pictures or conversation?'

So she was considering in her own mind (as well as she could, for the hot day made her feel very sleepy and stupid), whether the pleasure of making a daisy-chain would be worth the trouble of getting up and picking the daisies, when suddenly a White Rabbit with pink eyes ran close by her.

There was nothing so VERY remarkable in that; nor did Alice think it so VERY much out of the way to hear the Rabbit say to itself, 'Oh dear! Oh dear! I shall be late!' (when she thought it over afterwards, it occurred to her that she ought to have wondered at this, but at the time it all seemed quite natural); but when the Rabbit actually TOOK A WATCH OUT OF ITS WAISTCOAT-POCKET, and looked at it, and then hurried on, Alice started to her feet, for it flashed across her mind that she had never before seen a rabbit with either a waistcoat-pocket, or a watch to take out of it, and burning with curiosity, she ran across the field after it, and fortunately was just in time to see it pop down a large rabbit-hole under the hedge.

In another moment down went Alice after it, never once considering how in the world she was to get out again.

The rabbit-hole went straight on like a tunnel for some way, and then dipped suddenly down, so suddenly that Alice had not a moment to think about stopping herself before she found herself falling down a very deep well.

Either the well was very deep, or she fell very slowly, for she had plenty of time as she went down to look about her and to wonder what was going to happen next. First, she tried to look down and make out what she was coming to, but it was too dark to see anything; then she looked at the sides of the well, and noticed that they were filled with cupboards and book-shelves; here and there she saw maps and pictures hung upon pegs. She took down a jar from one of the shelves as she passed; it was labelled 'ORANGE MARMALADE', but to her great disappointment it was empty: she did not like to drop the jar for fear of killing somebody, so managed to put it into one of the cupboards as she fell past it.

'Well!' thought Alice to herself, 'after such a fall as this, I shall think nothing of tumbling down stairs! How brave they'll all think me at home! Why, I wouldn't say anything about it, even if I fell off the top of the house!' (Which was very likely true.)

Down, down, down. Would the fall NEVER come to an end! 'I wonder how many miles I've fallen by this time?' she said aloud. 'I must be getting somewhere near the centre of the earth. Let me see: that would be four thousand miles down, I think' (for, you see, Alice had learnt several things of this sort in her lessons in the schoolroom, and though this was not a VERY good opportunity for showing off her knowledge, as there was no one to listen to her, still it was good practice to say it over) '-yes, that's about the right distance-but then I wonder what Latitude or Longitude I've got to?' (Alice had no idea what Latitude was, or Longitude either, but thought they were nice grand words to say.)

Presently she began again. 'I wonder if I shall fall right THROUGH the earth! How funny it'll seem to come out among the people that walk with their heads downward! The Antipathies, I think-' (she was rather glad there WAS no one listening, this time, as it didn't sound at all the right word) '-but I shall have to ask them what the name of the country is, you know. Please, Ma'am, is this New Zealand or Australia?' (and she tried to curtsey as she spoke-fancy CURTSEYING as you're falling through the air! Do you think you could manage it?) 'And what an ignorant little girl she'll think me for asking! No, it'll never do to ask: perhaps I shall see it written up somewhere.'

Down, down, down. There was nothing else to do, so Alice soon began talking again. 'Dinah'll miss me very much to-night, I should think!' (Dinah was the cat.) 'I hope they'll remember her saucer of milk at tea-time. Dinah my dear! I wish you were down here with me! There are no mice in the air, I'm afraid, but you might catch a bat, and that's very like a mouse, you know. But do cats eat bats, I wonder?' And here Alice began to get rather sleepy, and went on saying to herself, in a dreamy sort of way, 'Do cats eat bats? Do cats eat bats?' and sometimes, 'Do bats eat cats?' for, you see, as she couldn't answer either question, it didn't much matter which way she put it. She felt that she was dozing off, and had just begun to dream that she was walking hand in hand with Dinah, and saying to her very earnestly, 'Now, Dinah, tell me the truth: did you ever eat a bat?' when suddenly, thump! thump! down she came upon a heap of sticks and dry leaves, and the fall was over.

Alice was not a bit hurt, and she jumped up on to her feet in a moment: she looked up, but it was all dark overhead; before her was another long passage, and the White Rabbit was still in sight, hurrying down it. There was not a moment to be lost: away went Alice like the wind, and was just in time to hear it say, as it turned a corner, 'Oh my ears and whiskers, how late it's getting!' She was close behind it when she turned the corner, but the Rabbit was no longer to be seen: she found herself in a long, low hall, which was lit up by a row of lamps hanging from the roof.

There were doors all round the hall, but they were all locked; and when Alice had been all the way down one side and up the other, trying every door, she walked sadly down the middle, wondering how she was ever to get out again.

Suddenly she came upon a little three-legged table, all made of solid glass; there was nothing on it except a tiny golden key, and Alice's first thought was that it might belong to one of the doors of the hall; but, alas! either the locks were too large, or the key was too small, but at any rate it would not open any of them. However, on the second time round, she came upon a low curtain she had not noticed before, and behind it was a little door about fifteen inches high: she tried the little golden key in the lock, and to her great delight it fitted!

Alice opened the door and found that it led into a small passage, not much larger than a rat-hole: she knelt down and looked along the passage into the loveliest garden you ever saw. How she longed to get out of that dark hall, and wander about among those beds of bright flowers and those cool fountains, but she could not even get her head through the doorway; 'and even if my head would go through,' thought poor Alice, 'it would be of very little use without my shoulders. Oh, how I wish I could shut up like a telescope! I think I could, if I only know how to begin.' For, you see, so many out-of-the-way things had happened lately, that Alice had begun to think that very few things indeed were really impossible.

There seemed to be no use in waiting by the little door, so she went back to the table, half hoping she might find another key on it, or at any rate a book of rules for shutting people up like telescopes: this time she found a little bottle on it, ('which certainly was not here before,' said Alice,) and round the neck of the bottle was a paper label, with the words 'DRINK ME' beautifully printed on it in large letters.

It was all very well to say 'Drink me,' but the wise little Alice was not going to do THAT in a hurry. 'No, I'll look first,' she said, 'and see whether it's marked \"poison\" or not'; for she had read several nice little histories about children who had got burnt, and eaten up by wild beasts and other unpleasant things, all because they WOULD not remember the simple rules their friends had taught them: such as, that a red-hot poker will burn you if you hold it too long; and that if you cut your finger VERY deeply with a knife, it usually bleeds; and she had never forgotten that, if you drink much from a bottle marked 'poison,' it is almost certain to disagree with you, sooner or later.

However, this bottle was NOT marked 'poison,' so Alice ventured to taste it, and finding it very nice, (it had, in fact, a sort of mixed flavour of cherry-tart, custard, pine-apple, roast turkey, toffee, and hot buttered toast,) she very soon finished it off.

'What a curious feeling!' said Alice; 'I must be shutting up like a telescope.'

And so it was indeed: she was now only ten inches high, and her face brightened up at the thought that she was now the right size for going through the little door into that lovely garden. First, however, she waited for a few minutes to see if she was going to shrink any further: she felt a little nervous about this; 'for it might end, you know,' said Alice to herself, 'in my going out altogether, like a candle. I wonder what I should be like then?' And she tried to fancy what the flame of a candle is like after the candle is blown out, for she could not remember ever having seen such a thing.

After a while, finding that nothing more happened, she decided on going into the garden at once; but, alas for poor Alice! when she got to the door, she found she had forgotten the little golden key, and when she went back to the table for it, she found she could not possibly reach it: she could see it quite plainly through the glass, and she tried her best to climb up one of the legs of the table, but it was too slippery; and when she had tired herself out with trying, the poor little thing sat down and cried.

'Come, there's no use in crying like that!' said Alice to herself, rather sharply; 'I advise you to leave off this minute!' She generally gave herself very good advice, (though she very seldom followed it), and sometimes she scolded herself so severely as to bring tears into her eyes; and once she remembered trying to box her own ears for having cheated herself in a game of croquet she was playing against herself, for this curious child was very fond of pretending to be two people. 'But it's no use now,' thought poor Alice, 'to pretend to be two people! Why, there's hardly enough of me left to make ONE respectable person!'

Soon her eye fell on a little glass box that was lying under the table: she opened it, and found in it a very small cake, on which the words 'EAT ME' were beautifully marked in currants. 'Well, I'll eat it,' said Alice, 'and if it makes me grow larger, I can reach the key; and if it makes me grow smaller, I can creep under the door; so either way I'll get into the garden, and I don't care which happens!'

She ate a little bit, and said anxiously to herself, 'Which way? Which way?', holding her hand on the top of her head to feel which way it was growing, and she was quite surprised to find that she remained the same size: to be sure, this generally happens when one eats cake, but Alice had got so much into the way of expecting nothing but out-of-the-way things to happen, that it seemed quite dull and stupid for life to go on in the common way.

So she set to work, and very soon finished off the cake.`

const jobs = "Governor Stevenson, Senator Johnson, Mr. Butler, Senator Symington, Senator Humphrey, Speaker Rayburn, Fellow Democrats, I want to express my thanks to Governor Stevenson for his generous and heart-warming introduction. It was my great honor to place his name in nomination at the 1956 Democratic Convention, and I am delighted to have his support and his counsel and his advice in the coming months ahead. With a deep sense of duty and high resolve, I accept your nomination. I accept it with a full and grateful heart--without reservation-- and with only one obligation--the obligation to devote every effort of body, mind and spirit to lead our Party back to victory and our Nation back to greatness. I am grateful, too, that you have provided me with such an eloquent statement of our Party\'s platform. Pledges which are made so eloquently are made to be kept. \"The Rights of Man\"--the civil and economic rights essential to the human dignity of all men--are indeed our goal and our first principles. This is a Platform on which I can run with enthusiasm and conviction. And I am grateful, finally, that I can rely in the coming months on so many others--on a distinguished running-mate who brings unity to our ticket and strength to our Platform, Lyndon Johnson--on one of the most articulate statesmen of our time, Adlai Stevenson--on a great spokesman for our needs as a Nation and a people, Stuart Symington--and on that fighting campaigner whose support I welcome, President Harry S. Truman-- on my traveling companion in Wisconsin and West Virginia, Senator Hubert Humphrey. On Paul Butler, our devoted and courageous Chairman. I feel a lot safer now that they are on my side again. And I am proud of the contrast with our Republican competitors. For their ranks are apparently so thin that not one challenger has come forth with both the competence and the courage to make theirs an open convention. I am fully aware of the fact that the Democratic Party, by nominating someone of my faith, has taken on what many regard as a new and hazardous risk--new, at least since 1928. But I look at it this way: the Democratic Party has once again placed its confidence in the American people, and in their ability to render a free, fair judgment. And you have, at the same time, placed your confidence in me, and in my ability to render a free, fair judgment--to uphold the Constitution and my oath of office--and to reject any kind of religious pressure or obligation that might directly or indirectly interfere with my conduct of the Presidency in the national interest. My record of fourteen years supporting public education--supporting complete separation of church and state--and resisting pressure from any source on any issue should be clear by now to everyone. I hope that no American, considering the really critical issues facing this country, will waste his franchise by voting either for me or against me solely on account of my religious affiliation. It is not relevant. I want to stress, what some other political or religious leader may have said on this subject. It is not relevant what abuses may have existed in other countries or in other times. It is not relevant what pressures, if any, might conceivably be brought to bear on me. I am telling you now what you are entitled to know: that my decisions on any public policy will be my own--as an American, a Democrat and a free man. Under any circumstances, however, the victory we seek in November will not be easy. We all know that in our hearts. We recognize the power of the forces that will be aligned against us. We know they will invoke the name of Abraham Lincoln on behalf of their candidate--despite the fact that the political career of their candidate has often seemed to show charity toward none and malice for all. We know that it will not be easy to campaign against a man who has spoken or voted on every known side of every known issue. Mr. Nixon may feel it is his turn now, after the New Deal and the Fair Deal--but before he deals, someone had better cut the cards. That \"someone\" may be the millions of Americans who voted for President Eisenhower but balk at his would be, self-appointed successor. For just as historians tell us that Richard I was not fit to fill the shoes of bold Henry II--and that Richard Cromwell was not fit to wear the mantle of his uncle--they might add in future years that Richard Nixon did not measure to the footsteps of Dwight D. Eisenhower. Perhaps he could carry on the party policies--the policies of Nixon, Benson, Dirksen and Goldwater. But this Nation cannot afford such a luxury. Perhaps we could better afford a Coolidge following Harding. And perhaps we could afford a Pierce following Fillmore. But after Buchanan this nation needed a Lincoln--after Taft we needed a Wilson-- after Hoover we needed Franklin Roosevelt. . . . And after eight years of drugged and fitful sleep, this nation needs strong, creative Democratic leadership in the White House. But we are not merely running against Mr. Nixon. Our task is not merely one of itemizing Republican failures. Nor is that wholly necessary. For the families forced from the farm will know how to vote without our telling them. The unemployed miners and textile workers will know how to vote. The old people without medical care--the families without a decent home--the parents of children without adequate food or schools--they all know that it\'s time for a change. But I think the American people expect more from us than cries of indignation and attack. The times are too grave, the challenge too urgent, and the stakes too high--to permit the customary passions of political debate. We are not here to curse the darkness, but to light the candle that can guide us through that darkness to a safe and sane future. As Winston Churchill said on taking office some twenty years ago: if we open a quarrel between the present and the past, we shall be in danger of losing the future. Today our concern must be with that future. For the world is changing. The old era is ending. The old ways will not do. Abroad, the balance of power is shifting. There are new and more terrible weapons--new and uncertain nations--new pressures of population and deprivation. One-third of the world, it has been said, may be free- -but one-third is the victim of cruel repression--and the other one- third is rocked by the pangs of poverty, hunger and envy. More energy is released by the awakening of these new nations than by the fission of the atom itself. Meanwhile, Communist influence has penetrated further into Asia, stood astride the Middle East and now festers some ninety miles off the coast of Florida. Friends have slipped into neutrality--and neutrals into hostility. As our keynoter reminded us, the President who began his career by going to Korea ends it by staying away from Japan. The world has been close to war before--but now man, who has survived all previous threats to his existence, has taken into his mortal hands the power to exterminate the entire species some seven times over. Here at home, the changing face of the future is equally revolutionary. The New Deal and the Fair Deal were bold measures for their generations--but this is a new generation. A technological revolution on the farm has led to an output explosion--but we have not yet learned to harness that explosion usefully, while protecting our farmers\' right to full parity income. An urban population explosion has overcrowded our schools, cluttered up our suburbs, and increased the squalor of our slums. A peaceful revolution for human rights--demanding an end to racial discrimination in all parts of our community life--has strained at the leashes imposed by timid executive leadership. A medical revolution has extended the life of our elder citizens without providing the dignity and security those later years deserve. And a revolution of automation finds machines replacing men in the mines and mills of America, without replacing their incomes or their training or their needs to pay the family doctor, grocer and landlord. There has also been a change--a slippage--in our intellectual and moral strength. Seven lean years of drouth and famine have withered a field of ideas. Blight has descended on our regulatory agencies--and a dry rot, beginning in Washington, is seeping into every corner of America--in the payola mentality, the expense account way of life, the confusion between what is legal and what is right. Too many Americans have lost their way, their will and their sense of historic purpose. It is a time, in short, for a new generation of leadership--new men to cope with new problems and new opportunities. All over the world, particularly in the newer nations, young men are coming to power--men who are not bound by the traditions of the past--men who are not blinded by the old fears and hates and rivalries-- young men who can cast off the old slogans and delusions and suspicions. The Republican nominee-to-be, of course, is also a young man. But his approach is as old as McKinley. His party is the party of the past. His speeches are generalities from Poor Richard\'s Almanac. Their platform, made up of left-over Democratic planks, has the courage of our old convictions. Their pledge is a pledge to the status quo--and today there can be no status quo. For I stand tonight facing west on what was once the last frontier. From the lands that stretch three thousand miles behind me, the pioneers of old gave up their safety, their comfort and sometimes their lives to build a new world here in the West. They were not the captives of their own doubts, the prisoners of their own price tags. Their motto was not \"every man for himself\"--but \"all for the common cause.\" They were determined to make that new world strong and free, to overcome its hazards and its hardships, to conquer the enemies that threatened from without and within. Today some would say that those struggles are all over--that all the horizons have been explored--that all the battles have been won-- that there is no longer an American frontier. But I trust that no one in this vast assemblage will agree with those sentiments. For the problems are not all solved and the battles are not all won--and we stand today on the edge of a New Frontier--the frontier of the 1960\'s--a frontier of unknown opportunities and perils-- a frontier of unfulfilled hopes and threats. Woodrow Wilson\'s New Freedom promised our nation a new political and economic framework. Franklin Roosevelt\'s New Deal promised security and succor to those in need. But the New Frontier of which I speak is not a set of promises--it is a set of challenges. It sums up not what I intend to offer the American people, but what I intend to ask of them. It appeals to their pride, not to their pocketbook--it holds out the promise of more sacrifice instead of more security. But I tell you the New Frontier is here, whether we seek it or not. Beyond that frontier are the uncharted areas of science and space, unsolved problems of peace and war, unconquered pockets of ignorance and prejudice, unanswered questions of poverty and surplus. It would be easier to shrink back from that frontier, to look to the safe mediocrity of the past, to be lulled by good intentions and high rhetoric--and those who prefer that course should not cast their votes for me, regardless of party. But I believe the times demand new invention, innovation, imagination, decision. I am asking each of you to be pioneers on that New Frontier. My call is to the young in heart, regardless of age--to all who respond to the Scriptural call: \"Be strong and of a good courage; be not afraid, neither be thou dismayed.\" For courage--not complacency--is our need today--leadership--not salesmanship. And the only valid test of leadership is the ability to lead, and lead vigorously. A tired nation, said David Lloyd George, is a Tory nation--and the United States today cannot afford to be either tired or Tory. There may be those who wish to hear more--more promises to this group or that--more harsh rhetoric about the men in the Kremlin--more assurances of a golden future, where taxes are always low and subsidies ever high. But my promises are in the platform you have adopted--our ends will not be won by rhetoric and we can have faith in the future only if we have faith in ourselves. For the harsh facts of the matter are that we stand on this frontier at a turning-point in history. We must prove all over again whether this nation--or any nation so conceived--can long endure--whether our society--with its freedom of choice, its breadth of opportunity, its range of alternatives--can compete with the single-minded advance of the Communist system. Can a nation organized and governed such as ours endure? That is the real question. Have we the nerve and the will? Can we carry through in an age where we will witness not only new breakthroughs in weapons of destruction--but also a race for mastery of the sky and the rain, the ocean and the tides, the far side of space and the inside of men\'s minds? Are we up to the task--are we equal to the challenge? Are we willing to match the Russian sacrifice of the present for the future--or must we sacrifice our future in order to enjoy the present? That is the question of the New Frontier. That is the choice our nation must make--a choice that lies not merely between two men or two parties, but between the public interest and private comfort--between national greatness and national decline--between the fresh air of progress and the stale, dank atmosphere of \"normalcy\"--between determined dedication and creeping mediocrity. All mankind waits upon our decision. A whole world looks to see what we will do. We cannot fail their trust, we cannot fail to try. It has been a long road from that first snowy day in New Hampshire to this crowded convention city. Now begins another long journey, taking me into your cities and homes all over America. Give me your help, your hand, your voice, your vote. Recall with me the words of Isaiah: \"They that wait upon the Lord shall renew their strength; they shall mount up with wings as eagles; they shall run and not be weary.\" As we face the coming challenge, we too, shall wait upon the Lord, and ask that he renew our strength. Then shall we be equal to the test. Then we shall not be weary. And then we shall prevail. Thank you. ";

